  false,\n\t\"url\": null,\n\t\"notes\": \"BPI Structures are derived from two scales
  of a focal mean analysis on bathymetry and slope. The grid is based on gridded (5
  m cell size) multibeam bathymetry, collected aboard NOAA ship Hi'ialakai and R/V
  AHI. It was created using the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/).
  Cell values represent one of 13 classes in an index of seafloor terrains. This data
  set is for Brooks Banks, Hawaii, USA.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
